import React from 'react'
import { PlacementTalksVideosData } from '../data/PlacementTalksVideosData'

function YoutubeEmbed(link) {
    return (
        <iframe width="100%" height="315" src={link} title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

    )

}
const PlacementTalksVideos = () => {
    return (
        <div>
            <header id="page-header">
                <div className="page-heading">
                    <h2>Placement Talks Videos</h2>
                </div>
            </header>

            <div className="page-container">
                <div className="row">
                    {PlacementTalksVideosData.map(item => {
                        return (
                            <>
                                <div className="col-md-6">
                                    {YoutubeEmbed("https://www.youtube.com/embed/x3VDjgSQFCg")}
                                </div>
                                <div className="col-md-6">
                                    <p>In this first episode of the campus placement talks, we have Mihir Jain, senior undergraduate computer science and engineering student talking about his placement at Google.</p>
                                </div>
                            </>
                        )
                    })}

                </div>






            </div>




        </div>
    )
}

export default PlacementTalksVideos
